const Card = ({name, image, temperament, weigth }) => {
    return(
        <div>
            <p>Nombre:{name}</p>
            <p>Image:{image}</p>
            <p>Temperamento:{temperament}</p>
            <p>Peso:{weigth}</p>
        </div>
    ) 
}

export default Card
